&lt;p class="info">&lt;b>Enrolment Control: RP&lt;/b>&#xd;
&lt;br>&#xd;
Initially restricted to students enrolled in Specialist program in Journalism and other students in &lt;b>1st year programs&lt;/b>. Starting shortly after &lt;b>3:00pm on Thursday, July 14th&lt;/b>, any remaining spaces in this course will be open to &lt;b>2nd, 3rd and 4th year students.&lt;/b>&#xd;
&lt;br/>Priority will be given to students enrolled in ACM programs.&lt;/p>

&lt;p class="info">&lt;b>Enrolment Control: P&lt;/b>&#xd;
&lt;br>&#xd;
Restricted to students enrolled in Specialist program in Journalism, and Major program in Media, Journalism and Digital Cultures (both streams). Starting shortly after&lt;b> 11:00am on Wednesday, July 20th&lt;/b>, any remaining spaces in this course will be open to other UTSC students.&#xd;
&lt;br/>This course is only for students currently enrolled or hope to be enrolled in an ACM programs. &lt;/p>

&lt;p class="info">&lt;b>Enrolment Control: R&lt;/b>&#xd;
