Restricted to students enrolled in ACM Programs.&lt;/p>

&lt;p class="info">&lt;b>Enrolment Control: AR&lt;/b>&#xd;
&lt;br>&#xd;
Restricted to students in the Arts Management Specialist programs.&#xd;
&lt;br>&lt;br>&#xd;
Permission of ACM Program Manager is required. You may select this course but will not be officially enrolled until approved.&#xd;
&lt;br>&#xd;
Check your status through ACORN to see whether you have been approved.&#xd;
&lt;br>&#xd;
&lt;b>(APP = approval; REF = refused; INT = no decision yet)&lt;/b>&#xd;
