&lt;p class="info">&lt;b> Enrolment Control: A&lt;/b>&#xd;
&lt;br>&#xd;
&lt;b>SUPERVISED STUDY/RESEARCH &amp; INDEPENDENT STUDY COURSES&lt;/b>&#xd;
&lt;br> &#xd;
&lt;b>Step 1:&lt;/b> &#xd;
Request the course on ACORN. Your status will be INT. You will not be officially enrolled until you complete the remaining steps (below). &#xd;
&lt;br> &#xd;
&lt;b>Step 2:&lt;/b>&#xd;
Meet with the Supervisor and obtain their signature on a 'Supervised Study form'. Make sure the course code, supervisor name and title of the project is clearly printed on the form as this information will appear on your transcript. The Supervised Study form is available at: &lt;a href=' https://www.utsc.utoronto.ca/registrar/supervised-study-form '>https://www.utsc.utoronto.ca/registrar/supervised-study-form&lt;/a>.&#xd;
 Your Department listed below may require additional paperwork. Students should contact the Office listed for more information.&#xd;
&lt;br> &#xd;
&lt;b>Step 3:&lt;/b>&#xd;
Submit the signed Supervised Study form and additional paperwork by email to Manaal Hussain &lt;a href='mailto:acm-pa@utsc.utoronto.ca'>acm-pa@utsc.utoronto.ca&lt;/a>&#xd;
&lt;br>&lt;br>&#xd;
Staff will update your course status on ACORN from interim (INT) to approved (APP).&#xd;
&lt;br> &#xd;
&lt;b>Arts, Culture, and Media Office AA325&lt;/b>&#xd;
&lt;/p>

